import {createRoot} from "react-dom/client";

function Section(){
  return(<>
  <h1>Header</h1>
  <h1>Navbar</h1>
  <h1>Section</h1>
  </>);
}

function Navbar(){
  return(<>
  <Section/>
  </>);
}

function Header(){
  return(<>
  <Navbar/>
  </>);
}

function MainComponent(){
  return(<>
  <Header/>
  </>);
}
createRoot(document.getElementById("demo")).render(<MainComponent/>);
